using ShineEngine;

/// <summary>
/// 场景类型(generated by shine)
/// </summary>
public class SceneType
{
	/// <summary>
	/// 长度
	/// </summary>
	public static int size=1;
	
	/// <summary>
	/// 获取实例类型
	/// </summary>
	public static int getInstanceType(int type)
	{
		return SceneTypeConfig.get(type).instanceType;
	}
	
}
